import React from 'react'

export default class StatLine extends React.Component {
    render() {
        return (
            <>
                <tr>
                    <h2>...{this.props.name}?</h2>
                </tr>
                <tr>
                    <td>
                        <button id = {'button-' + this.props.index + '-1'}>
                            {this.props.pokemon1.name}
                        </button>
                    </td>
                    <td>
                        <button id = {'button-' + this.props.index + '-unsure'}>
                            I'm not sure
                        </button>
                    </td>
                    <td>
                        <button id = {'button-' + this.props.index + '-2'}>
                            {this.props.pokemon2.name}
                        </button>
                    </td>
                </tr>
            </>
        );
    }
}
